var historyArrayName = "$parent." + env.get("PropertyName") + "_hist";
var outMsg = {};
outMsg.topic = "put";
var timestamp = context.flow.get("$parent.timestamp");
if (typeof timestamp == "undefined") {
    timestamp = new Date().getTime();
}
outMsg.payload = {
    link: env.get("PropertyLink"),
    tstamp: timestamp,
    data: context.flow.get("variable")
};
let history = context.flow.get(historyArrayName) || [];
if (history.length >= env.get("HistoryLength")) {
    history.pop();
}
history.push(outMsg.payload);
context.flow.set(historyArrayName, history);
return outMsg;

